import styled from "styled-components";

export const POItemMenuDiv = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: space-around;
  padding: 10px;
  border-bottom: 1px solid #808080;
`;

export const POItemMenuItem = styled.div`
  flex: 1;
`;
